import React, { useState } from "react";
import uniqid from "uniqid";

import { Field } from "components";

const createEmptyField = () => {
  let field = new Array(9);

  field.map(item => {
    item._id = uniqid();
    item.isEmpty = true;
  });

  return field;
};

const Game = () => {
  const [field, setField] = useState(
    new Array(9).fill({
      isEmpty: true
    })
  );

  // console.log(field[0]);
  field.map(item => {
    console.log(uniqid());
    item._id = uniqid();
  });
  field.map(item => {
    console.log(item);
  });

  return <Field field={field} />;
};

export default Game;
